import React, { useState, useEffect } from 'react';
import { useAuth } from '../contexts/TokenAuthContext';
import Sidebar from './Sidebar';
import Header from './Header';
import TodoWidget from './widgets/TodoWidget';
import NBAWidget from './widgets/NBAWidget';
import PortfolioWidget from './widgets/PortfolioWidget';
import ClientWidget from './widgets/ClientWidget';
import ChatWidget from './widgets/ChatWidget';
import MessageDraftWidget from './widgets/MessageDraftWidget';
import CalendarWidget from './widgets/CalendarWidget';
import DataIngestionWidget from './widgets/DataIngestionWidget';
import ChatTest from './ChatTest';
import './MainDashboard.css';

const MainDashboard = () => {
  const { user, signOut } = useAuth();
  const [activeSection, setActiveSection] = useState('dashboard');
  const [sidebarCollapsed, setSidebarCollapsed] = useState(false);

  return (
    <div className="main-dashboard">
      <Header 
        user={user} 
        onSignOut={signOut}
        onToggleSidebar={() => setSidebarCollapsed(!sidebarCollapsed)}
      />

      <div className="dashboard-container">
        <Sidebar 
          activeSection={activeSection}
          onSectionChange={setActiveSection}
          collapsed={sidebarCollapsed}
        />

        <main className={`dashboard-main ${sidebarCollapsed ? 'sidebar-collapsed' : ''}`}>
          <div className="dashboard-content">
            <h1>Super Banking Advisor Copilot</h1>

            {activeSection === 'dashboard' && (
              <div className="dashboard-grid">
                {/* Priority Alerts Section */}
                <div className="priority-alerts">
                  <h2>Priority Alerts</h2>
                  <TodoWidget />
                </div>

                {/* Next Best Actions */}
                <div className="nba-section">
                  <h2>Next Best Actions</h2>
                  <NBAWidget />
                </div>

                {/* Portfolio Overview */}
                <div className="portfolio-overview">
                  <h2>Portfolio Insights</h2>
                  <PortfolioWidget />
                </div>

                {/* Client Management */}
                <div className="client-management">
                  <h2>Client Management</h2>
                  <ClientWidget />
                </div>
              </div>
            )}

            {activeSection === 'todo' && (
              <div className="section-content">
                <h2>Daily To-Do List</h2>
                <TodoWidget expanded={true} />
              </div>
            )}

            {activeSection === 'clients' && (
              <div className="section-content">
                <h2>Client Portfolio Analysis</h2>
                <ClientWidget expanded={true} />
                <PortfolioWidget expanded={true} />
              </div>
            )}

            {activeSection === 'messages' && (
              <div className="section-content">
                <h2>Message Center</h2>
                <MessageDraftWidget />
              </div>
            )}

            {activeSection === 'calendar' && (
              <div className="section-content">
                <h2>Calendar & Meetings</h2>
                <CalendarWidget />
              </div>
            )}

            {activeSection === 'chat' && (
              <div className="section-content">
                <h2>Advisor Assistant</h2>
                <ChatTest />
                <ChatWidget />
              </div>
            )}

            {activeSection === 'analytics' && (
              <div className="section-content">
                <h2>Analytics Dashboard</h2>
                <PortfolioWidget expanded={true} />
                <DataIngestionWidget />
              </div>
            )}
          </div>
        </main>
      </div>
    </div>
  );
};

export default MainDashboard;
